Unspent transaction output with server without any indices: curl -s -H "Accept: application/json" \ http://0.0.0.0:80/r/utxo/4a5e1e4baab89f3a32518a88c31bc87f618f76673e2cc77ab2127b7afdeda33b:0 { "inscriptions": null, "runes": null, "sat_ranges": null, "value": 5000000000
} With rune, inscription, and sat index: curl -s -H "Accept: application/json" \ http://0.0.0.0:80/r/utxo/626860df36c1047194866c6812f04c15ab84f3690e7cc06fd600c841f1943e05:0 { "inscriptions": [ "6fb976ab49dcec017f1e201e84395983204ae1a7c2abf7ced0a85d692e442799i0" ], "runes": { "UNCOMMON•GOODS": { "amount": 6845, "divisibility": 0, "symbol": "⧉" } }, "sat_ranges": [ [ 1905800627509113, 1905800627509443 ] ], "value": 330
} Note: <SAT_NUMBER> only allows the actual number of a sat no other sat notations like degree, percentile or decimal. We may expand to allow those in the future. Responses from most of the above recursive endpoints are JSON. For backwards compatibility, some endpoints are supported which only return plain-text responses. /blockheight: altura do bloco mais recente. /blockhash: hash do bloco mais recente. /blockhash/<ALTURA>: hash do bloco em uma determinada altura de bloco. /blocktime: marca de tempo UNIX do bloco mais recente. See examples for on-chain examples of inscriptions that feature this functionality.
